// ------------------------------------------------------------
// ScareMail
// by Benjamin Grosser
// http://bengrosser.com
//
// Version 1.0.1 (for Gmail)
// http://bengrosser.com/projects/scaremail/
// 
// Premiere Exhibition:
// 2013 PRISM Break-Up, Eyebeam, NYC
